function fixName(name:string) : string
{
    return name.replace(/[ \(\)-]/g, "_");
}

export default () =>
{
    var parsed = JSON.parse(data);

    var output:string = "";

    for (var i = 0; i < parsed.length; i++)
    {
        var prefab = parsed[i];

        var prefabName = fixName(prefab.Name);

        output += `export const ${prefabName} = { hash : ${prefab.Hash}`;

        var names = [];

        for (var j = 0; j < prefab.Embedded.length; j++)
        {
            var embedded = prefab.Embedded[j];

            var embeddedName = fixName(embedded.Name);
            var tempName = embeddedName;
            var index = 0;

            while (names.includes(tempName))
            {
                index++;
                tempName = embeddedName + index;
            }

            names.push(tempName);

            output += `,  ${tempName} : ${embedded.Hash}`;
        }

        output += `}\n`;
    }

    console.log(output);
}